function ClientDrink(json) {


    this.IntervalId;
    this.DrinkId ;
    this.Name;
    this.Price;
    this.Base64Image;

    this.Image = function () {
        return 'data:image/png;base64,' + this.Base64Image;
    };

    for(var prop in json)
    {
        this[prop] = json[prop];
        if (prop === "Base64Image" && json[prop] === "") {
            this.Base64Image = "";
        }
    }


}

